import { Card } from "react-bootstrap";
import { useState, useEffect } from "react";
const ViewedPeople = ({ message, data }) => {
  const [users, getUsers] = useState([]);
  const token = process.env.REACT_APP_TOKENACCESS;
  const url = "https://striveschool-api.herokuapp.com/api/profile/";

  const fetchUsers = async () => {
    try {
      let response = await fetch(url, {
        method: "GET",
        headers: {
          Authorization: "Bearer " + token,
        },
      });
      if (response.ok) {
        let data = await response.json();
        getUsers({ data });
      } else {
        console.log("Error");
      }
    } catch (error) {
      console.log(error);
    }
  };

  useEffect(() => {
    fetchUsers();
  }, []);
  const num = [1, 2, 3, 4, 5];

  const listgenerate = () => {
    return (
      <li className="d-flex mt-3">
        <div className="card-imgs">
          <Card.Img
            src="https://image.flaticon.com/icons/png/512/149/149071.png"
            alt="user"
          />
        </div>
        <div className="card-person ml-3">
          <Card.Title>Iqboljon Zokiorv</Card.Title>
          <Card.Subtitle className="text-left">
            Senior Major Incident Manager at Capgemini
          </Card.Subtitle>
          <div className="text-left p-0 mt-1">
            <button>{message}</button>
          </div>
        </div>
      </li>
    );
  };
  return (
    <ul className="people">
      {users.data.slice(0, 5).map((n) => (
        <li className="d-flex mt-3">
          <div className="card-imgs">
            <Card.Img
              src="https://image.flaticon.com/icons/png/512/149/149071.png"
              alt="user"
            />
          </div>
          <div className="card-person ml-3">
            <Card.Title>Iqboljon Zokiorv</Card.Title>
            <Card.Subtitle className="text-left">
              Senior Major Incident Manager at Capgemini
            </Card.Subtitle>
            <div className="text-left p-0 mt-1">
              <button>{message}</button>
            </div>
          </div>
        </li>
      ))}
    </ul>
  );
};

export default ViewedPeople;
